class ScheduleHandler {
  config;
  octokit;
  context = import_github3.context;
  issueService;
  commentService;
  constructor() {
    this.config = getConfig();
    this.octokit = createOctokitClient(this.config.githubToken);
    const repoContext = {
      owner: this.context.repo.owner,
      repo: this.context.repo.repo
    };
    this.issueService = new IssueService(this.octokit, repoContext);
    this.commentService = new CommentService(this.octokit, repoContext);
  }
  async handle_unassignments() {
    const { unassignIssues, reminderIssues } = await this._get_assigned_issues();
    let processedUnassignments = [];
    let processedReminders = [];
    if (unassignIssues.length > 0) {
      processedUnassignments = await this._process_unassignments(unassignIssues);
    }
    if (!this.config.enableReminder) {
      await this._generate_summary(processedUnassignments, processedReminders);
      return;
    }
    if (reminderIssues.length > 0) {
      processedReminders = await this._process_reminders(reminderIssues);
    }
    await this._generate_summary(processedUnassignments, processedReminders);
  }
  async _get_assigned_issues() {
    const { owner, repo } = this.context.repo;
    const {
      daysUntilUnassign,
      reminderDays: configReminderDays,
      assignedLabel,
      pinLabel
    } = this.config;
    let reminderDays;
    if (configReminderDays === "auto") {
      reminderDays = Math.floor(daysUntilUnassign / 2);
    } else {
      reminderDays = configReminderDays;
    }
    const {
      data: { items: issues }
    } = await this.octokit.request("GET /search/issues", {
      q: `repo:${owner}/${repo} is:issue is:open label:"${assignedLabel}" -label:"${pinLabel}" assignee:*`,
      per_page: 100,
      advanced_search: true,
      headers: {
        "X-GitHub-Api-Version": "2022-11-28"
      }
    });
    const unassignIssues = [];
    const reminderIssues = [];
    const chunks = chunkArray(issues, 10);
    for (let i = 0;i < chunks.length; i++) {
      const chunk = chunks[i];
      const results = chunk.map((issue) => ({
        issue,
        lastActivityDate: new Date(issue.updated_at),
        daysSinceActivity: getDaysBetween(new Date(issue.updated_at), new Date)
      }));
      for (const result of results.filter(Boolean)) {
        const hasReminderLabel = result.issue?.labels?.some((label) => label?.name === "\uD83D\uDD14 reminder-sent");
        let shouldUnassign = result.daysSinceActivity >= daysUntilUnassign;
        if (hasReminderLabel) {
          shouldUnassign = shouldUnassign || result.daysSinceActivity >= daysUntilUnassign - reminderDays;
        }
        if (shouldUnassign) {
          unassignIssues.push({ ...result, hasReminderLabel });
          continue;
        }
        if (result.daysSinceActivity >= reminderDays) {
          if (!hasReminderLabel) {
            reminderIssues.push({ ...result, hasReminderLabel });
          }
        }
      }
    }
    core11.info(`\uD83D\uDCCB Found ${unassignIssues.length} issues to unassign`);
    core11.info(`\uD83D\uDD14 Found ${reminderIssues.length} issues to send reminders for`);
    return { unassignIssues, reminderIssues };
  }
  async _process_unassignments(arr) {
    const processedResults = [];
    const unassignedIssueNumbers = [];
    const chunks = chunkArray(arr, 5);
    for (let i = 0;i < chunks.length; i++) {
      const chunk = chunks[i];
      const results = await Promise.allSettled(chunk.map(async ({ issue, ...rest }) => {
        try {
          await this._unassign_issue(issue);
          return { issue, ...rest };
        } catch (_err) {
          return { issue, ...rest };
        }
      }));
      processedResults.push(...results.filter((r) => r.status === "fulfilled").map((r) => r.value));
      unassignedIssueNumbers.push(...results.filter((r) => r.status === "fulfilled").map((r) => r.value.issue.number));
      if (i < chunks.length - 1) {
        await new Promise((resolve) => setTimeout(resolve, 1000));
      }
    }
    core11.setOutput("unassigned_issues", unassignedIssueNumbers);
    return processedResults;
  }
  async _process_reminders(arr) {
    const processedResults = [];
    const chunks = chunkArray(arr, 5);
    for (let i = 0;i < chunks.length; i++) {
      const chunk = chunks[i];
      const results = await Promise.allSettled(chunk.map(async ({ issue, daysSinceActivity, ...rest }) => {
        try {
          await this._send_reminder_for_issue(issue, daysSinceActivity);
          return { issue, daysSinceActivity, ...rest };
        } catch (_err) {
          return { issue, daysSinceActivity, ...rest };
        }
      }));
      processedResults.push(...results.filter((r) => r.status === "fulfilled").map((r) => r.value));
    }
    return processedResults;
  }
  async _unassign_issue(issue) {
    if (!issue.assignee) {
      core11.warning(` Issue #${issue.number} has no assignee, skipping...`);
      return;
    }
    const { unassignedComment, pinLabel, assignedLabel } = this.config;
    const body = this.commentService.renderTemplate(unassignedComment, {
      handle: issue.assignee.login,
      pin_label: pinLabel
    });
    await this.issueService.unassignWithLabels(issue.number, issue.assignee.login, [assignedLabel, pinLabel, "\uD83D\uDD14 reminder-sent"]);
    await this.commentService.createComment(issue.number, body);
  }
  async _send_reminder_for_issue(issue, daysSinceActivity) {
    const { daysUntilUnassign, reminderComment, pinLabel } = this.config;
    const daysRemaining = Math.max(0, daysUntilUnassign - daysSinceActivity);
    const body = this.commentService.renderTemplate(reminderComment, {
      handle: issue.assignee?.login,
      days_remaining: daysRemaining,
      pin_label: pinLabel
    });
    await Promise.all([
      this.issueService.addLabel(issue.number, "\uD83D\uDD14 reminder-sent"),
      this.commentService.createComment(issue.number, body)
    ]);
  }
  async _generate_summary(processedUnassignments, processedReminders) {
    if (processedUnassignments.length === 0 && processedReminders.length === 0) {
      core11.info(" No issues to summarize.");
      return;
    }
    const unassignedTable = processedUnassignments.map(({ issue, daysSinceActivity }) => ({
      Issue: `[#${issue.number}](https://github.com/${this.context.repo.owner}/${this.context.repo.repo}/issues/${issue.number})`,
      Assignee: issue.assignee?.login ? `[@${issue.assignee.login}](https://github.com/${issue.assignee.login})` : "Unassigned",
      "Days Since Activity": `${daysSinceActivity || "N/A"}`,
      Status: "Unassigned"
    }));
    const reminderTable = processedReminders.map(({ issue, daysSinceActivity }) => ({
      Issue: `[#${issue.number}](https://github.com/${this.context.repo.owner}/${this.context.repo.repo}/issues/${issue.number})`,
      Assignee: issue.assignee?.login ? `[@${issue.assignee.login}](https://github.com/${issue.assignee.login})` : "Unassigned",
      "Days Since Activity": `${daysSinceActivity || "N/A"}`,
      Status: "Reminder Sent"
    }));
    const summary2 = [
      "## \uD83D\uDCCB Summary of Processed Issues",
      "",
      `**Total Issues Processed:** ${processedUnassignments.length + processedReminders.length}`,
      `**Unassigned:** ${processedUnassignments.length} | **Reminders Sent:** ${processedReminders.length}`,
      "",
      "### Unassigned Issues",
      "",
      unassignedTable.length > 0 ? `| Issue | Assignee | Days Since Activity | Status |` + `
` + `|-------|----------|--------------------|--------|` + `
${unassignedTable.map((row) => `| ${row.Issue} | ${row.Assignee} | ${row["Days Since Activity"]} | ${row.Status} |`).join(`
`)}` : "No unassigned issues found.",
      "",
      "### Reminder Sent Issues",
      "",
      reminderTable.length > 0 ? `| Issue | Assignee | Days Since Activity | Status |` + `
` + `|-------|----------|--------------------|--------|` + `
${reminderTable.map((row) => `| ${row.Issue} | ${row.Assignee} | ${row["Days Since Activity"]} | ${row.Status} |`).join(`
`)}` : "No reminder sent issues found.",
      ""
    ];
    core11.summary.addRaw(summary2.join(`
`));
    await core11.summary.write();
  }
}

// src/index.ts
(async () => {
  const event = import_github5.context.eventName;
  try {
    if (event === "issue_comment") {
      const cmtHandler = new CommentHandler;
      await cmtHandler.handle_issue_comment();
    } else if (event === "workflow_dispatch" || event === "schedule") {
      const scheduleHandler = new ScheduleHandler;
      await scheduleHandler.handle_unassignments();
    } else {
      return;
    }
  } catch (error) {
    if (error instanceof Error)
      return core12.setFailed(error.message);
  }
})();
